                        "title": "Promptbook: Features and Guidelines",
                        "content": "## Additional Features and Notes\n\n### Security\n   Follow the Security Policy for reporting vulnerabilities.\n\n### Developer Packages\n   The library consists of multiple packages that can be installed either all at once or individually.\n\n### Glossary of Terms\n   Basic AI/LLM terms and core concepts related to Promptbook, including data management, pipeline control, media handling, and anomaly detection.\n\n### Promptbook Engine\n   Guidelines for when to use the Promptbook engine, known issues, and its limitations.\n\n### Support & Community\n   Contributions and feedback are welcomed to improve the Book language. ",
